import React from "react"
import Cards from "../Cards/Cards.js";
import './Home.css';
import saltomario from '../../img/saltomario.png'
import saltoluigui from '../../img/saltoluigui.png'
import estrella from '../../img/estrella.png'
import derecha from '../../img/derecha.png'
import izquieda from '../../img/izquierda.png'
import { connect } from "react-redux";

import { Listado } from "../../Redux/actions.js";

const Home = ({busqueda})=>{
busqueda.map((dato)=>{
  return  console.log("esto es la busque da en el home"+dato.name);
})
    

    return (
    
            <div className="bodyHome">
                <div className="containerHome">
                <div>
                    <img src={saltomario} alt="salto mario" className="manejoimagenmario"/>
                </div>
                 <div className="containerHomeCard">
                 <Cards className="containerHomeCard" busqueda={busqueda}/>
                    
                    </div>
                    <div>
                    <img src={saltoluigui} alt="salto mario" className="manejoimagenluigui"/>
                </div>   
                </div>  
                <div className="paginas">
                    <div>
                        <img src={izquieda} alt="Anterior" className="anterior" />
                        <img src={estrella} alt="mario" className="estrella"/>
                        <img src={derecha} alt="siguiente" className="siguiente" />
                    </div>


                </div>
            </div>)
}


const mapStateToProps =(state)=>{
    return {
        busqueda: state.allVideoGamer
    }
 }
 
 const mapDispatchToProps = (dispatch) =>{
    return {
       busqueda: (busqueda)=>{dispatch(Listado(busqueda))},
    }
 }
 


export default connect(
    mapStateToProps,
    mapDispatchToProps
 )(Home)
